import { makeAutoObservable } from "mobx"

export default class ClothesStore {
    constructor() {
        this._types = [
            {id: 1, name: 'Верхняя одежда'},
            {id: 2, name: 'Нижняя одежда'},
            {id: 3, name: 'Обувь'}
        ]
