            {id: 4, name: 'Шорты летние', price: 2890, raiting: 3},
            {id: 5, name: 'Футболка алкоголичка', price: 1500, raiting: 10},
            {id: 6, name: 'Шорты летние', price: 2890, raiting: 3},
        ]
        this._selectedType = {}
        this._selectedBrand = {}
        makeAutoObservable(this)
    }

