        this._types = types
    }
    setBrands(brands) {
        this._brands = brands
    }
    setClothes(clothes) {
        this._clothes = clothes
    }
    setSelectedType(type){
        this._selectedType = type
    }
    setSelectedBrand(brand){
        this._selectedBrand = brand
    }

    get types() {
        return this._types
    }
    get brands() {
        return this._brands
    }
    get clothes() {
        return this._clothes
